import React from 'react';
import { View } from 'react-native';
import { AntDesign } from '@expo/vector-icons';

// Components
import CustomText from '../CustomText';

function CartContainer() {
	return (
		<View style={{ justifyContent: 'center', alignItems: 'center', backgroundColor: 'white', flex: 1 }}>
			<View>
				<View style={{ backgroundColor: 'red', width: 68, borderRadius: 120 }}>
					<AntDesign name="shoppingcart" size={58} color={'grey'} />
				</View>

				<CustomText customStyle={{ textAlign: 'center' }}>سبد خرید شما خالی است .</CustomText>
			</View>
		</View>
	);
}

export default CartContainer;
